import React, { Component } from "react";

class Atlassian extends Component {	 
	render() {
		return (
            <div className='subheader'>
                <div className='major'>
                    <br></br>
                    <p>Atlassian is a global software compare with offices in 7 countries and over 3000 employees. It develops products for software developers, project managers and content management, the core mission being “to help unleash the potential of every team through open work”.</p>
                    <p>From medicine to space travel, Atlassian’s operations span the entire globe and covers a variety of software including but not limited to Jira, Trello, Confluence, Bitbucket, Sourcetree, Bamboo, Crowd and acquired products like OpsGenie and Agilecraft.</p>
                    <p>Diversity is a huge part of the Atlassian culture and this is reflected in the various perspectives and ways of solving problems within their teams.</p>
                 </div>
                <br></br>
                <a href="https://www.atlassian.com/" className="button" >Visit Atlassian</a>
            </div>
        );
	}
}

export default Atlassian;
